import React, { useState } from 'react';


function Examresult1() {
  const [marks, setMarks] = useState({
    English: '',
    Hindi: '',
    SocialScience: '',
    Science: '',
    Mathematics: '',
    Subject6: '',
  });

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setMarks((prevMarks) => ({
      ...prevMarks,
      [name]: value,
    }));
  };

  return (
    <div className="container">
      <h1>Exam Marks Table</h1>
      <table className="marks-table">
        <thead>
          <tr>
            <th>Subject</th>
            <th>Marks</th>
          </tr>
        </thead>
        <tbody>
          {Object.keys(marks).map((subject, index) => (
            <tr key={index}>
              <td>{subject}</td>
              <td>
                <input
                  type="text"
                  name={subject}
                  value={marks[subject]}
                  onChange={handleInputChange}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Examresult;
